import React, { useState } from 'react';
import '../General.css';

const ElGamalEncryption: React.FC = () => {
    const [p, setP] = useState<string>(''); // Số nguyên tố lớn
    const [g, setG] = useState<string>(''); // Generator
    const [a, setA] = useState<string>(''); // Public key
    const [m, setM] = useState<string>(''); // Message
    const [cipherText, setCipherText] = useState<[number, number] | null>(null);
    const [decryptedCipher, setDecryptedCipher] = useState<[number, number] | null>(null);
    const [publicKey, setPublicKey] = useState<[number, number] | null>(null);
    const [privateKey, setPrivateKey] = useState<[number, number] | null>(null);
    const [result, setResult] = useState<string | null>(null);
    const [error, setError] = useState<string | null>(null);

    const handleEncrypt = async () => {
        setError(null); // Reset lỗi trước mỗi lần gọi API
        setResult(null); // Reset result trước mỗi lần gọi API

        // Kiểm tra nếu các input không rỗng
        if (!p || !g || !a || !m) {
            setError('Please fill in all fields');
            return;
        }

        try {
            const response = await fetch('http://localhost:5000/encrypt/elgamal', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    p: parseInt(p),
                    g: parseInt(g),
                    a: parseInt(a),
                    m: parseInt(m),
                }),
            });

            const data = await response.json();

            // Xử lý phản hồi từ API
            if (data.result !== "Successful") {
                setError(data.result); // Hiển thị lỗi nếu result không phải "Successful"
                setDecryptedCipher(null)
                setCipherText(null);
                setPublicKey(null);
                setPrivateKey(null);
            } else {
                setPrivateKey(data.privateKey);
                setCipherText(data.publicKey);
                setCipherText(data.cipherText);
                setDecryptedCipher(data.decryptedCipher);
                setResult(data.result); // Hiển thị kết quả thành công
            }
        } catch (err) {
            console.error('Error:', err);
            setError('Failed to connect to server.');
        }
    };

    return (
        <div className="container">
            <h1>ElGamal Encryption</h1>
            <h2>Step 1: Enter a prime number p</h2>
            <div className="input-group">
                <label>p:</label>
                <input type="number" value={p} onChange={(e) => setP(e.target.value)} />
            </div>
            <h2>Step 2: Enter a generator g</h2>
            <div className="input-group">
                <label>g:</label>
                <input type="number" value={g} onChange={(e) => setG(e.target.value)} />
            </div>
            <h2>Step 3: Enter public key y</h2>
            <div className="input-group">
                <label>a:</label>
                <input type="number" value={a} onChange={(e) => setA(e.target.value)} />
            </div>
            <h2>Step 4: Enter the message</h2>
            <div className="input-group">
                <label>m:</label>
                <input type="number" value={m} onChange={(e) => setM(e.target.value)} />
            </div>
            <button onClick={handleEncrypt}>Encrypt</button>

            {/* Hiển thị lỗi nếu có */}
            {error && <p style={{ color: 'red' }}>Error: {error}</p>}

            {/* Hiển thị kết quả nếu thành công */}
            {result === "Successful" && cipherText && (
                <div>
                    <p>
                        <>Public Key:</> K' = publicKey[0]
                    </p>
                    <p>
                        <>Private Key:</> K'' = {privateKey}
                    </p>
                    <p>
                        <strong>Encrypted Message:</strong> c1 = {cipherText[0]}, c2 = {cipherText[1]}
                    </p>
                    <p>
                        <strong>Decrypted Cipher:</strong> d = {decryptedCipher}
                    </p>
                    <p style={{color: 'green'}}>
                        <strong>Result:</strong> {result}
                    </p>
                </div>
            )}
        </div>
    );
};

export default ElGamalEncryption;
